import React, { useEffect } from "react";

const TokenList = () => {
  const coinlist = `https://pro-api.coingecko.com/api/v3/coins/list?x_cg_pro_api_key=`;

  const makeApiCall = async () => {
    const res = await fetch(coinlist);
    const rawData = await res.json();
    console.log(rawData);

    useEffect(() => {
      // GET request using axios inside useEffect React hook
      axios
        .get("https://api.npms.io/v2/search?q=react")
        .then((response) => setTotalReactPackages(response.data.total));

      // empty dependency array means this effect will only run once (like componentDidMount in classes)
    }, []);

    return (
      <div>
        <makeApiCall />
      </div>
    );
  };
};

export default TokenList;
